let allbox = document.getElementById('allbox');
let allbox2 = document.getElementById('allbox2');
let allbox3 = document.getElementById('allbox3');
let allbox4 = document.getElementById('allbox4');
let allbox5 = document.getElementById('allbox5');
let footer = document.getElementById('footer');
let list = document.getElementById('list');



function page(test,box){
    let html = ''
    test.forEach((item,index) => {
        html += `
           <div class='list' onclick='listfun()'>
               <div class='back' id='back'>
                  <span id='imgs'>${item.imgs2}</span>
               </div>
               <p>${item.name}</p>
           </div>
        `
    })
    box.innerHTML = html;
}
function footfun(test,box){
    let html = ''
    test.forEach((item,index) => {
        html += `
           <div>
             <span>${item.imgs}</span>
             <p>${item.name}</p>
           </div>
        `
    })
    box.innerHTML = html;
}

function listfun(){
        if(event.target.id == 'back' || event.target.id == 'imgs'){
            let html =''
            all.forEach((item,index) => {
            $('#back').css('background-color',`${item.bgcolor}`)
            html += `
            <span id='imgs'>${item.imgs}</span>
            `
             })
             $('#back').html(html)
         }
      
}


window.onload = function(){
    page(all,allbox)
    page(all,allbox2)
    page(all,allbox3)
    page(all,allbox4)
    page(all,allbox5)
    footfun(foot,footer)
}